import React from 'react'
import "./services.css"
import img1 from '../../collateral/services/branding.svg'
import img2 from '../../collateral/services/design.svg'
import img3 from '../../collateral/services/development.svg'
import img4 from '../../collateral/services/seo.svg'

const servicesLists = [
    {
        id: 1,
        image: img1,
        title: "Graphic Design",
        desc: "build a graphic dsign"
    },
    {
        id: 2,
        image: img2,
        title: "Graphic Design",
        desc: "build a graphic dsign"
    },
    {
        id: 3,
        image: img3,
        title: "Graphic Design",
        desc: "build a graphic dsign"
    },
    {
        id: 4,
        image: img4,
        title: "Graphic Design",
        desc: "build a graphic dsign"
    }
]

const Services = () => {
  return (
    <section className="services section">
        <h2 className="services-title">Service</h2>
        <div className="services-container">
            {servicesLists.map(({id, image, title, desc}) => {
                return (
                    <div className="services-card-id" key={id}>
                        <img className="services-image" src={image} alt=''/>
                        <h3 className="services-title">{title}</h3>
                        <p className="services-description">{desc}</p>
                    </div>
                );
            }

            )}
        </div>
    </section>
  )
}

export default Services
